Remember when you asked us to make an astrology app? Well, WE DID IT. I am so excited to announce the launch of the CHANI app - an astrology app for self-discovery, mindfulness, and healing. It’s available to download for iPhone NOW!!! @chani.app 

My hope is that this app is your personalized guide through life’s ups and downs. Combining the wisdom of the stars with mindfulness and meditation, the app supports your growth and well-being. 

With the most detailed birth chart explanations available, real-time updates on the astrology of the moment, a library of meditations, new and full moon workshops + a private journal to set intentions and track growth, the CHANI app was created as a tool for self-discovery. 

The app was built by @Anniecannons a queer-led software development agency whose engeneers have all experienced human trafficking and/or gender-based violnce. 5% of the app’s profits will be disbursed to Black, Latinx, Native/Indigenous, Queer and/or Trans survivors of gender-based violence by @freefromdotorg 

The CHANI app would not have been possible without our contributing writers: @camwhiteastro @charmastrology @divineorbitastrology @ddamascenaa @diegobasdeo @dendraletheia @thestrology @immaterialnerd @toxic.haste @staciaram @thedailyhunch & Forest Taipale all of which added their unique take on this ancient art. Thank you for working with us through an extremely challenging year. 

@miminew thank you for your relentlessness, dedication, and drive. No one does a launch like you, but no one knows the efforts it takes to get to the finish line with the best product possible like you, we are so grateful for your vision, creativity, and expertise. 

@jeannakadlec thank you for your countless hours, weeks, and months of editing, writing, and shaping the sentiments expressed in this app. You took on a massive project that required untold patience and dedication and we are so grateful for all your efforts. 

@decentastro thank you for your gorgeous collages that are world unto themselves  @mishaspice your illustrations and images added a charm that’s truly magical.
